import React from 'react';

const StartPageX = ({ displayNextQuestion, svgUrls, backgroundImage }) => {
  return (
    <div style={{color:'#121212',height:'calc(100vh - 40px)',display:'flex',flexDirection:'column',padding:'20px',alignItems:'center',justifyContent:'center',textAlign:'center'}}>
        <img src={svgUrls.lark} alt="Lark Logo" style={{ width: '120px', padding:"20px"}} />
        <h1 style={{ margin: '20px 0', fontSize: '32px' }}>Welcome to Lark’s Workplace Personality Quiz!</h1>
      <h2 style={{ margin: '20px 0', fontSize: '12px' }}>Embark on a fun journey to discover your unique work style and preferences! Get ready to dive into exciting scenarios and uncover insights that'll help you thrive in the workplace!</h2>
        <button id="start-btn" style={{ marginBottom: '20px' }} onClick={() => displayNextQuestion(null)}><span style={{ fontWeight: '600' }}>Start Quiz →</span></button>
    </div>
  );
};

export default StartPageX;
